export const ItemStockColumns = [
  { id: "itemName", label: "상품명", key: "itemName" },
  { id: "isQty",    label: "현재재고", key: "isQty",    align: "right" },
  { id: "totalIn",  label: "누적입고", key: "totalIn",  align: "right" },
  { id: "totalOut", label: "누적출고", key: "totalOut", align: "right" },
];
